import styled from 'styled-components';

export const SignInContainer = styled.div`
    width: 380px;
    display: flex;
    flex-direction: column;

    .title {
        margin: 10px 0px;
    }

    .buttons {
        display: flex;
        justify-content: space-between;
    }
`;
